import React from 'react'
import styled from 'styled-components'


const Heading =styled.h1`
    color:red;
    margin:0;
padding:0;
`

const Content = () => {
    return (
        <div>
            <Heading>Information Technology Specialist</Heading>
            <h5>Eindhoven, North Brabant, Netherlands</h5>
        </div>
    )
}

export default Content
